import { Component } from '@angular/core';

@Component({
  selector: 'app-test',
  template: `
    <div>
      <div [ngSwitch]="age">
        <h2 *ngSwitchCase="1" >Number 1</h2>
        <h2 *ngSwitchCase="2" >Number 2</h2>
        <h2 *ngSwitchCase="3" >Number 3</h2>
        <h2 *ngSwitchDefault >No number</h2>
      </div>
      <div *ngFor="let fruit of fruits; index as i;even as e">
        {{i}}{{e}} {{fruit}}
      </div>
    </div>
  `,
  styles: []
})
export class TestComponent {
  age = 3;
  fruits = ['apple', 'orange', 'banana'];

  onClick(inp: any){
    console.log(inp);
  }
  onInputChange(event : Event){
    const inputValue = (event.target as HTMLInputElement).value
    console.log(inputValue);
  }



}
